import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import BasicSelect from '../../components/IdeaComponents/Select';
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
    Form: {
        flex: 1,
        backgroundColor: theme.palette.background.paper,
    },
    div: {
        padding: 24,
        paddingTop: 0,
        display: "flex",
        gap: 20,
    }
}));

const AddIdea = () => {
    const classes = useStyles();

    return (
        <Box component = 'form' className={classes.Form}>
            <div className={classes.div}>
                <TextField id="ideaName" label="Name of Idea" variant="standard" />
            </div>
            <div className={classes.div}>
                <TextField id="ideaDescription" label="Description" variant="standard" />
            </div>
            <div className={classes.div}>
                <BasicSelect />
            </div>
            <div>
            <Button
                variant="contained"
                style={{
                width: 85,
                height: 40,
                marginLeft: 15,
                color: "black",
                backgroundColor: "#EEBC1D",
                float: "right"
                }}
            >
                Add
            </Button>
            </div>
        </Box>
    )
}

export default AddIdea
